set -euo pipefail
repo="BillChirico/bills-bot"
# Get open PR basics
prs=$(gh pr list --repo "$repo" --state open --json number,title,headRefName,author,url)
python3 - <<'PY'
import json, subprocess, os, sys
repo='BillChirico/bills-bot'
prs=json.loads('''$prs''')
bot_names={"coderabbitai","renovate"}
results=[]
for pr in prs:
    author=(pr.get('author') or {}).get('login') or ''
    is_bot=author.endswith('[bot]') or author in bot_names
    if is_bot:
        results.append({"number":pr['number'],"author":author,"skipped":True,"reason":"bot-authored"})
        continue
    num=pr['number']
    q=f'''query {{
      repository(owner:"BillChirico",name:"bills-bot") {{
        pullRequest(number:{num}) {{
          reviewThreads(first:100) {{
            nodes {{
              id
              isResolved
              path
              line
              startLine
              comments(first:3) {{
                nodes {{
                  body
                  author {{ login }}
                }}
              }}
            }}
          }}
        }}
      }}
    }}'''
    out=subprocess.check_output(['gh','api','graphql','-f',f'query={q}'], text=True)
    data=json.loads(out)
    nodes=(data.get('data',{}).get('repository',{}).get('pullRequest',{}).get('reviewThreads',{}).get('nodes',[]) or [])
    unresolved=[]
    for t in nodes:
        if t.get('isResolved'):
            continue
        comments=t.get('comments',{}).get('nodes',[]) or []
        summary=''
        if comments:
            body=(comments[0].get('body') or '').strip().replace('\n',' ')
            summary=' '.join(body.split())[:280]
        unresolved.append({
            'id':t.get('id'),
            'path':t.get('path'),
            'line':t.get('line') or t.get('startLine'),
            'summary':summary
        })
    results.append({
        'number':num,
        'title':pr.get('title'),
        'url':pr.get('url'),
        'author':author,
        'branch':pr.get('headRefName'),
        'skipped':False,
        'unresolvedCount':len(unresolved),
        'unresolved':unresolved
    })
print(json.dumps(results))
